function map() {
    let key = this.zipcode
    var result = {
        "key": { "zipCode": key },
        "value": {
            "premiumAmount": this.premiumAmount,
            //"chunkId": this.chunkId,
            "companyCode": this.companyCode
        }
    }
    emit(
        result.key, result.value.premiumAmount,
    )
}
